import React from 'react';
import '../CSS/Footer.css'
export default function Footer () {
    return(

        <div className="Footer">
            <div className="container">
                
                    <div className="row">
                        <p>Nuestras Paginas</p>
                    </div>
                    <div className="row">
                        <p>Contacto</p>

                    </div>
                    <div className="row">
                        <p>Información de Interés</p>
                    </div>
                
            </div>
        </div>

    );
}
